import "./App.css";
import User from "./pages/User";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default function App() {
  return;
  <div>
    <Router>
      <Routes>
        {tables.map((table) => (
          <Route
            exact
            path={table.link}
            element={<Table tableId={table.id} />}
          />
        ))}
        <Route exact path="/" element={<Home />} />
      </Routes>
    </Router>
    <User />
  </div>;
}
